import styled from 'styled-components';

export const InfoWrapper = styled.div`
  display: flex;
  padding: 100px 64px;
  flex-direction: column;
  align-items: center;
`;

export const InfoImages = styled.div`
display: flex;
flex - direction: row;
`;

export const InfoImg = styled.img`
  width: 350px;
  margin-bottom: 60px;
`;

export const InfoTitle = styled.h1`
  font-size: 60px;
  margin-bottom: 30px;
`;
